import './App.css';
import React, { Component } from 'react';

class App extends Component {
  state = { dots: [{color: "blue", x: 20, y: 20}, {color: "red", x: 0, y: 0}, {color: "yellow", x: 50, y: 25}, {color: "lime", x: 30, y: 75}] }

  dotPositions = (dots) => {
    var dict = {blue: "https://www.mikeball.com/wp-content/uploads/2016/03/blue-dot.png", red: "https://upload.wikimedia.org/wikipedia/commons/0/0e/Basic_red_dot.png", yellow: "https://img.pngio.com/filegaudit-yellowdotpng-wikimedia-commons-yellow-dot-png-460_460.png", lime: "https://upload.wikimedia.org/wikipedia/commons/thumb/7/7f/Location_dot_lime.svg/1024px-Location_dot_lime.svg.png"};
    const dotMap = dots.map((dot) =>
      <img src={dict[dot.color]} width="15px" height="15px" style={{position: "absolute", left: dot.x, top: dot.y}}/>
    );
    return dotMap
  }

  // of form [{color: ---, x: ---, y: ---}]
  updatePositions = (dotsToPositions) => {
    var currentDotPositions = this.state.dots
    const newDotPositions = dotsToPositions.map((dot) =>
      console.log(dot)
    );
    return newDotPositions
  }

  render() { 
    const dotPos = this.dotPositions(this.state.dots)
    console.log(dotPos)
    console.log(this.updatePositions([{color: "blue", x: 200, y: 200}, {color: "red", x: 100, y: 100}, {color: "yellow", x: 110, y: 125}, {color: "lime", x: 250, y: 275}]))
    return (
      <div>
        <img src="https://i.redd.it/ldfi6xzs56t51.png" width="80%" height="auto" />

        {dotPos}
      </div>
    )
  }
}

export default App;
